import React from "react";
import { FaSearch } from "react-icons/fa";
import { Card, CardContent } from "./components/ui/card";
import { Button } from "./components/ui/button";
import "./App.css";

const Navbar = () => (
  <nav className="navbar">
    <h1 className="logo">The Media Ant</h1>
    <div className="search-bar">
      <input type="text" placeholder="Search Channel, Media" />
      <FaSearch />
    </div>
    <div className="nav-buttons">
      <button>Contact Us</button>
      <button>Login</button>
      <button>Your Bag</button>
    </div>
  </nav>
);

const HeroSection = () => (
  <section className="hero">
    <h2>Empowering All To Advertise</h2>
    <p>Buy best media Ad</p>
    <div className="hero-cards">
      <div className="card">Find<br />Media Rates</div>
      <div className="card">Plan<br />Media Spend</div>
      <div className="card">Buy<br />Media Spots</div>
    </div>
  </section>
);

const AdBanner = () => (
  <div className="ad-banner">
    <p className="ad-text">ðŸŽ‰ Advertising in IPL 2025 on Jio Cinema</p>
    <p>Packages Start at 5 Lakhs</p>
  </div>
);

const App = () => {
  return (
    <div>
      <Navbar />
      <HeroSection />
      <AdBanner />
    </div>
  );
};

export default App;
